$(document).ready(()=>{$(".progress-bar").css("width",model.xp/model.xpNeeded*100+"%");let n=new Vue({el:"#tabContent",data:{myQuizzes:{entries:[],pages:0,canEdit:!1},historyList:{entries:[],pages:0,showSummary:!1},myGroups:{entries:[],pages:0},myQuizzesClicked:!1,myGroupsClicked:!1},mounted:function(){this.historyListCallback(1);$("#myQuizzes-tab").click(()=>{this.myQuizzesClicked||(this.myQuizzesCallback(1),this.myQuizzesClicked=!0)});$("#myGroups-tab").click(()=>{this.myGroupsClicked||(this.myGroupsCallback(1),this.myGroupsClicked=!0)})},methods:{historyListCallback:function(n){let t=this;axios.get(util.apiUrl("/api/quiz/getList/history",{page:n,size:global.quizCardAmount,username:model.userName})).then(function(n){global.debug&&util.logResponse(n);t.historyList.entries=n.data.entries;t.historyList.pages=n.data.pages;t.historyList.showSummary=n.data.showSummary}).catch(n=>util.logResponse(n.response))},myQuizzesCallback:function(n){let t=this;axios.get(util.apiUrl(`/api/quiz/getList/quizzesBy`,{page:n,size:global.quizCardAmount,username:model.userName})).then(function(n){global.debug&&util.logResponse(n);t.myQuizzes.entries=n.data.entries;t.myQuizzes.pages=n.data.pages;t.myQuizzes.canEdit=n.data.canEdit}).catch(n=>util.logResponse(n.response))},myGroupsCallback:function(n){let t=this;axios.get(util.apiUrl(`/api/group/getList/user`,{page:n,size:global.membersCardAmount,username:model.userName})).then(function(n){global.debug&&util.logResponse(n);t.myGroups.entries=n.data.entries;t.myGroups.pages=n.data.pages}).catch(n=>util.logResponse(n.response))}}})});